# Error Handling

Example of error handling in `getPlayer` method.

```js
const { Errors } = require('hypixel-api-reborn');
// invalid nickname
hypixel
  .getPlayer('3424242')
  .then((player) => {})
  .catch((e) => {
    if (e.message === Errors.PLAYER_DOES_NOT_EXIST) {
      console.log(`Player doesn't exist!`);
      // here you can replace default error message with yours.
    }
  });
```

getStatus.content:
# getStatus

Allows you to get the status of a player.

## Arguments

- Player nickname or UUID
- [Method options](https://hypixel-api-reborn.github.io/#/docs/main/master/typedef/MethodOptions) (optional)

## Example usage

```js
const Hypixel = require('hypixel-api-reborn');
const hypixel = new Hypixel.Client('API-KEY');

hypixel
  .getStatus('StavZDev')
  .then((status) => {
    console.log(status);
  })
  .catch((e) => {
    console.error(e);
  });

// async/await
const status = await hypixel.getStatus('StavZDev').catch((e) => console.error(e));
console.log(status); // if player doesn't exist will return null
```

## Example response

```js
Status {
  online: true,
  game: Game { game: 'SKYWARS', id: 51, code: 'SKYWARS' },
  mode: 'LOBBY',
  map: null
}
```

